pub enum Quote {

    /// Double quote: `"`
    Double,

    /// Single quote: `'`
    Single,

    /// No quote
    None,
}

pub enum BellStyle {

    /// Beep
    Audible,

    /// Silent
    None,

    /// Flash screen (not supported)
    Visible,
}

pub enum HistoryDuplicates {

    /// No filter
    AlwaysAdd,

    /// a line will not be added to the history if it matches the previous entry
    IgnoreConsecutive,
}

pub enum CompletionType {

    /// Complete the next full match (like in Vim by default)
    Circular,

    /// Complete till longest match.
    /// When more than one match, list all matches
    /// (like in Bash/Readline).
    List,
}

pub enum EditMode {

    /// Emacs keymap
    Emacs,

    /// Vi keymap
    Vi,
}

pub enum ColorMode {

    /// Activate highlighting if platform/terminal is supported.
    Enabled,

    /// Activate highlighting even if platform is not supported (windows < 10).
    Forced,

    /// Deactivate highlighting even if platform/terminal is supported.
    Disabled,
}

pub enum OutputStreamType {

    /// Use stderr
    Stderr,

    /// Use stdout
    Stdout,
}

pub enum ReadlineError {

    /// I/O Error
    Io(io::Error),

    /// EOF (Ctrl-D)
    Eof,

    /// Ctrl-C
    Interrupted,

    /// Chars Error
    #[cfg(unix)]
    Utf8Error,

    /// Unix Error from syscall
    #[cfg(unix)]
    Errno(nix::Error),
}

pub enum Direction {

    /// Search history forward
    Forward,

    /// Search history backward
    Reverse,
}

pub enum Cmd {

    /// abort
    Abort,

    /// accept-line
    AcceptLine,

    /// beginning-of-history
    BeginningOfHistory,

    /// capitalize-word
    CapitalizeWord,

    /// clear-screen
    ClearScreen,

    /// complete
    Complete,

    /// complete-backward
    CompleteBackward,

    /// complete-hint
    CompleteHint,

    /// downcase-word
    DowncaseWord,

    /// vi-eof-maybe
    EndOfFile,

    /// end-of-history
    EndOfHistory,

    /// forward-search-history
    ForwardSearchHistory,

    /// history-search-backward
    HistorySearchBackward,

    /// history-search-forward
    HistorySearchForward,

    /// Insert text
    Insert(RepeatCount, String),

    /// Interrupt signal (Ctrl-C)
    Interrupt,

    /// backward-delete-char, backward-kill-line, backward-kill-word
    /// delete-char, kill-line, kill-word, unix-line-discard, unix-word-rubout,
    /// vi-delete, vi-delete-to, vi-rubout
    Kill(Movement),

    /// backward-char, backward-word, beginning-of-line, end-of-line,
    /// forward-char, forward-word, vi-char-search, vi-end-word, vi-next-word,
    /// vi-prev-word
    Move(Movement),

    /// next-history
    NextHistory,

    /// No action
    Noop,

    /// vi-replace
    Overwrite(char),

    /// previous-history
    PreviousHistory,

    /// quoted-insert
    QuotedInsert,

    /// vi-change-char
    ReplaceChar(RepeatCount, char),

    /// vi-change-to, vi-substitute
    Replace(Movement, Option<String>),

    /// reverse-search-history
    ReverseSearchHistory,

    /// self-insert
    SelfInsert(RepeatCount, char),

    /// Suspend signal (Ctrl-Z on unix platform)
    Suspend,

    /// transpose-chars
    TransposeChars,

    /// transpose-words
    TransposeWords(RepeatCount),

    /// undo
    Undo(RepeatCount),

    /// Unsupported / unexpected
    Unknown,

    /// upcase-word
    UpcaseWord,

    /// vi-yank-to
    ViYankTo(Movement),

    /// yank, vi-put
    Yank(RepeatCount, Anchor),

    /// yank-pop
    YankPop,

    /// moves cursor to the line above or switches to prev history entry if
    /// the cursor is already on the first line
    LineUpOrPreviousHistory(RepeatCount),

    /// moves cursor to the line below or switches to next history entry if
    /// the cursor is already on the last line
    LineDownOrNextHistory(RepeatCount),

    /// accepts the line when cursor is at the end of the text (non including
    /// trailing whitespace), inserts newline character otherwise
    AcceptOrInsertLine,
}

pub enum Word {

    /// non-blanks characters
    Big,

    /// alphanumeric characters
    Emacs,

    /// alphanumeric (and '_') characters
    Vi,
}

pub enum At {

    /// Start of word.
    Start,

    /// Before end of word.
    BeforeEnd,

    /// After end of word.
    AfterEnd,
}

pub enum Anchor {

    /// After cursor
    After,

    /// Before cursor
    Before,
}

pub enum CharSearch {

    /// Forward search
    Forward(char),

    /// Forward search until
    ForwardBefore(char),

    /// Backward search
    Backward(char),

    /// Backward search until
    BackwardAfter(char),
}

pub enum Movement {

    /// Whole current line (not really a movement but a range)
    WholeLine,

    /// beginning-of-line
    BeginningOfLine,

    /// end-of-line
    EndOfLine,

    /// backward-word, vi-prev-word
    BackwardWord(RepeatCount, Word),

    /// forward-word, vi-end-word, vi-next-word
    ForwardWord(RepeatCount, At, Word),

    /// vi-char-search
    ViCharSearch(RepeatCount, CharSearch),

    /// vi-first-print
    ViFirstPrint,

    /// backward-char
    BackwardChar(RepeatCount),

    /// forward-char
    ForwardChar(RepeatCount),

    /// move to the same column on the previous line
    LineUp(RepeatCount),

    /// move to the same column on the next line
    LineDown(RepeatCount),

    /// Whole user input (not really a movement but a range)
    WholeBuffer,

    /// beginning-of-buffer
    BeginningOfBuffer,

    /// end-of-buffer
    EndOfBuffer,
}

pub enum KeyPress {

