    BracketedPasteStart,

    /// Paste (on unix platform)
    BracketedPasteEnd,

    /// Single char
    Char(char),

    /// Ctrl-↓
    ControlDown,

    /// Ctrl-←
    ControlLeft,

    /// Ctrl-→
    ControlRight,

    /// Ctrl-↑
    ControlUp,

    /// Ctrl-char
    Ctrl(char),

    /// ⌦
    Delete,

    /// ↓ arrow key
    Down,

    /// ⇲
    End,

    /// ↵ or `KeyPress::Ctrl('M')`
    Enter,

    /// Escape or `KeyPress::Ctrl('[')`
    Esc,

    /// Function key
    F(u8),

    /// ⇱
    Home,

    /// Insert key
    Insert,

    /// ← arrow key
    Left,

    /// Escape-char or Alt-char
    Meta(char),

    /// `KeyPress::Char('\0')`
    Null,

    /// ⇟
    PageDown,

    /// ⇞
    PageUp,

    /// → arrow key
    Right,

    /// Shift-↓
    ShiftDown,

    /// Shift-←
    ShiftLeft,

    /// Shift-→
    ShiftRight,

    /// Shift-↑
    ShiftUp,

    /// ⇥ or `KeyPress::Ctrl('I')`
    Tab,

    /// ↑ arrow key
    Up,
}

pub enum WordAction {

    /// Capitalize word
    CAPITALIZE,

    /// lowercase word
    LOWERCASE,

    /// uppercase word
    UPPERCASE,
}

pub enum ValidationResult {

    /// Incomplete input
    Incomplete,

    /// Validation fails with an optional error message. User must fix the
    /// input.
    Invalid(Option<String>),

    /// Validation succeeds with an optional message
    Valid(Option<String>),
}

